import TypeIt from 'typeit-react';
// import './styles.css';

export default function App() {
  return (
    <div className="App">
      <TypeIt>This will be typed in a `span` element!</TypeIt>
      <TypeIt options={{ breakLines: false }} element="h1">
        Developer
        <br />
        Engineer
        <br />
        Writer
      </TypeIt>

      <TypeIt options={{ breakLines: false }} element="h1">
        {`Developer 
        Engineer 
        Writer`}
      </TypeIt>
    </div>
  );
}
